    function on_render_screen(renderscreen)
        local sr = renderscreen:scaled_resolution()
        renderfps = client.fps()
        if true then
            local text1 = rh:serverip() == "pc.bjd-mc.com" and watermark_clientname:get_string() or "Visuals Extra"
            if rh:serverip() == "pc.bjd-mc.com"  then
                rh:java_set_title(watermark_clientname:get_string() .. " " .. watermark_clientversion:get_string())
            end
            local text2 = " - " .. tostring(luaversion) .. " - "
            local text3 = module_manager.get_state("nameprotect") and rh:getmodulevalue("nameprotect","name") or user.get_username()
            local text3max = rh:module_state("nameprotectextra") and ("Neverlose.cc" .. rh:getmodulevalue("nameprotectextra","Prefix") .. rh:getmodulevalue("nameprotectextra","Suffix")) or (module_manager.get_state("nameprotect") and rh:getmodulevalue("nameprotect","name") or user.get_username())
            local usertext = text1 .. text2 .. text3
            local infox = renderscreen:scaled_resolution():width() - shader.string_width("MuseoCyrl16",usertext) - 3
            local infoy = renderscreen:scaled_resolution():height() - shader.font_height("MuseoCyrl16") - (getmodulevalue("Interface","User Info") and 9.2 or 2)
            rh:Client_Draw_String("MuseoCyrl16",text1,infox - 2.5,infoy,"Visuals Info Show Text")
            shader.draw_string("MuseoCyrl16",text2,infox + shader.string_width("MuseoCyrl16",text1),infoy,rgba(128,128,128,255))
            rh:Client_Draw_String("MuseoCyrl16",text3,infox + shader.string_width("MuseoCyrl16",text1 .. text2),infoy,"Visuals Info Show Text2",utf8_len(text3max)*2 + 100)
        end
        if misc_init and misc_tick >= 60 then
            misc_init = false
        end
        if watermark_enable:get_boolean() then
            local bgcolor = rgba(15, 27, 51, 200)
            local x = watermark_x:get_double()
            local y = watermark_y:get_double()
            local font = watermark_fontm:get_string()
            local cname = watermark_clientname:get_string()
            local cver = watermark_clientversion:get_string()
            local round = watermark_round:get_double()
            if watermark_style:get_string() == "RShen" then
                local markpos = 39
                shader.round_rect(x, y, markpos, 15, round, bgcolor)
                --shader.draw_string(font, clientname,x + 35,y + 6,rgb(20,255,255), watermark_fontshadow:get_boolean())
                renderimage(x + 2, y - 9, 35, -1,
                    "data:image/png;base64,")
                -- mark2
                local marktext = ""
                if watermark_user:get_boolean() then
                    marktext = marktext .. " | " .. user.get_username()
                end
                if watermark_fps:get_boolean() then
                    marktext = marktext .. " | " .. renderfps .. " FPS"
                end
                if watermark_time:get_boolean() then
                    marktext = marktext .. " | " .. os.date("%H:%M:%S")
                end
                if watermark_serverip:get_boolean() then
                    if world.is_singlePlayer() then
                        marktext = marktext .. " | Singleplayer"
                    else
                        marktext = marktext .. " | " .. world.get_server()
                    end
                end
                if string.sub(marktext, 1, 3) == " | " then
                    marktext = string.sub(marktext, 4, string.len(marktext))
                end
                if marktext ~= "" then
                    shader.round_rect(x + markpos + 5, y, 10 + shader.string_width(font, marktext), 15,
                        round, bgcolor)
                    shader.draw_string(font, marktext, x + markpos + 9, y + 5, -1, watermark_fontshadow:get_boolean())
                end
            end
    
            if watermark_style:get_string() == "OneTap" then
                local currentTimeTable = os.date("*t")
        
                local hour = currentTimeTable.hour
                local minute = currentTimeTable.min
                local second = currentTimeTable.sec
            
                local formattedTime = string.format("%02d:%02d:%02d", hour, minute, second)
            
                local watermark = cname .. " ".. (cver ~= "" and "[" .. cver .. "] " or "") .. "| " .. user.get_username()
                if watermark_serverip:get_boolean() then
                    if world.is_singlePlayer() then
                        watermark = watermark .. " | Local Server"
                    else
                        watermark = watermark .. " | " .. world.get_server()
                    end
            
                end
                local watermark = watermark .. " | " .. formattedTime
                draw_session(watermark_x:get_double(),watermark_y:get_double() - shader.font_height(watermark_fontm:get_string()),watermark)
    
            end
    
            if watermark_style:get_string() == "Neverskid" then
                --shader.draw_string(font, clientname,x + 35,y + 6,rgb(20,255,255), watermark_fontshadow:get_boolean())
                renderimage(x, y , 90, -1,
                    data_watermark_neverskid_logo)
            end
    
            if watermark_style:get_string() == "Xylitol" then
                --shader.draw_string(font, clientname,x + 35,y + 6,rgb(20,255,255), watermark_fontshadow:get_boolean())
