                if global_blur:get_boolean() then
                    shader.push_blur()
                    shader.round_rect(x + 5, y - 0.5, 9 + shader.string_width(font,cname .. marktext), 15,round, -1)
                    shader.pop_blur(global_bluramount:get_double())
                end
                shader.round_rect(x + 5, y - 0.5, 9 + shader.string_width(font,cname .. marktext), 15,round, rgba(0,0,0,75))
                shader.gradient_string(font, cname, x +7 , y + 5,128,0.3)
                shader.draw_string(font, marktext, x +7.5 + shader.string_width(font,cname), y + 5, -1, false)
            end
    
            if watermark_style:get_string() == "Neverlose" then
                local markpos = 27
                font = "MuseoCyrl16"
                shader.round_rect(x, y, markpos, 16, round, bgcolor)
                --shader.draw_string(font, clientname,x + 35,y + 6,rgb(20,255,255), watermark_fontshadow:get_boolean())
                renderimage(x + 4.3, y + 0.3, 18, -1,"data:image/png;base64,")
