                end
                if watermark_nlfps:get_boolean() then
                    marktext = marktext .. " |       " .. renderfps .. " fps"
                    table.insert(imagepos,shader.string_width(font,marktext .. " | ") + 1)
                end
                if watermark_nlserverip:get_boolean() then
                    if world.is_singlePlayer() then
                        marktext = marktext .. " |      Local Server"
                    else
                        marktext = marktext .. " |       " .. world.get_server()
                    end
                    table.insert(imagepos,shader.string_width(font,marktext .. " | ") + 2)
