-- Functions
function rgb(r, g, b)
    if math.abs(r) ~= r then
        r = 255 - math.abs(r)
    end
    if math.abs(g) ~= g then
        g = 255 - math.abs(g)
    end
    if math.abs(b) ~= b then
        b = 255 - math.abs(b)
    end
    r = math.min(255, math.max(0, r))
    g = math.min(255, math.max(0, g))
    b = math.min(255, math.max(0, b))
    local color = (r * 256 + g) * 256 + b
    return color
end
