function arrsort(arr,arr2)
	local len = #arr
	for i = 2,len do
		local temp = arr[i]
        local temp2 = arr2[i]
		local j = i-1
		while(j >= 1 and temp > arr[j]) do
			arr[j+1] = arr[j]
            arr2[j+1] = arr2[j]
			j = j-1;
		end
		arr[j+1] = temp;
        arr2[j+1] = temp2;
	end
end
function math.Floor2(nNum, n)
    if type(nNum) == "nil" then
        return 0
    end
    local t= 1
    for i = 1, n do
        t = t / 10
    end
    return tonumber(nNum) - tonumber(nNum)%tonumber(t)
end
function math.Floor3(nNum, n)
    if type(nNum) == "nil" then
        return 0
    end
    local t= 1
    for i = 1, n do
        t = t / 10
    end
    if math.floor(nNum - nNum%t)>=nNum - nNum%t then
        return nNum - nNum%t .. ".0"
    end
    return nNum - nNum%t
end
function math.Round(nNum, n)
    if type(nNum) ~= "number" then
        return nNum
    end
    n = n or 0
    n = math.floor(n)
    if n < 0 then
        n = 0
    end
    n = n or 0;
    n = math.floor(n)
    if n < 0 then
        n = 0;
    end
    local format = "%." .. n .. "f"
    return string.format(format, nNum)
end
