function secondsToTime(ts)
    local seconds =math.modf(math.fmod(ts, 60))
    local min = math.floor(ts/60)
    local hour = math.floor(min/60) 
    
    local str = ""
        
    if tonumber(seconds) < 60 then
        str = seconds.."s" ..str
    end

    if tonumber(min - hour*60)<60 then
        str = (min - hour*60).."m "..str
    end

    if tonumber(hour)<24 then
        str = (hour).."h "..str
    end

    return str
end
function formatTime(seconds)
    local hours = math.floor(seconds / 3600)
    local minutes = math.floor((seconds % 3600) / 60)
    local remainingSeconds = seconds % 60

    local formattedTime = ""
    
    if hours > 0 then
        formattedTime = hours .. "h "
    end
    
    if minutes > 0 then
        formattedTime = formattedTime .. minutes .. "m "
    end
    
    formattedTime = formattedTime .. remainingSeconds .. "s"
    
    return formattedTime
end
