function shader.air_round_rect(x,y,width,height,linewidth,color,roundsize)
    render.rect(x - width/2,y - height/2 + roundsize,linewidth,height - roundsize*2 + 1,color) -- left
    render.rect(x + width/2,y - height/2 + roundsize,linewidth,height - roundsize*2 + linewidth,color) -- right
    render.rect(x - width/2 + roundsize - linewidth ,y - height/2,width - roundsize*2 + linewidth,linewidth,color) -- up
    render.rect(x - width/2 + roundsize,y + height/2,width+linewidth - roundsize*2,linewidth,color) -- down
    shader.circle2(x + width/2 - roundsize -1,y - height/2 +roundsize +1,roundsize +1 , 1, 45, 0.65,color) -- right up
    shader.circle2(x + width/2 - roundsize ,y + height/2 -roundsize,roundsize , 1, 45, 0.65, color,0.01,0) -- right down
    shader.circle2(x - width/2 + roundsize,y - height/2 +roundsize,roundsize, 1, 45, 0.65, color,0.01,180) -- left up
    shader.circle2(x - width/2 + roundsize ,y + height/2 -roundsize,roundsize , 1, 45, 0.65, color,0.01,90) -- left down
end
