    if roundsize > 10 then
        shader.vertical_gradient_rect(x - width/2,y - height/2 + roundsize + linewidth,linewidth ,height - roundsize*2,color,color2) -- left
        shader.vertical_gradient_rect(x + width/2,y - height/2 + roundsize,linewidth ,height - roundsize*2 + linewidth,color2,color) -- right
        shader.gradient_rect(x - width/2 + roundsize - linewidth ,y - height/2,width - roundsize*2 + linewidth,linewidth,color,color2) -- up
        shader.gradient_rect(x - width/2 + roundsize,y + height/2,width+linewidth - roundsize*2,linewidth,color2,color) -- down
        shader.circle2(x + width/2 - roundsize ,y - height/2 +roundsize ,roundsize , 1, 45, 0.55,color2) -- right up
        shader.circle2(x + width/2 - roundsize ,y + height/2 -roundsize,roundsize , 1, 45, 0.55, color,0.01,0) -- right down
        shader.circle2(x - width/2 + roundsize,y - height/2 +roundsize,roundsize , 1, 45, 0.55, color,0.01,180) -- left up
        shader.circle2(x - width/2 + roundsize ,y + height/2 -roundsize,roundsize , 1, 45, 0.55, color2,0.01,90) -- left down
    else
        shader.vertical_gradient_rect(x - width/2 - 0.5,y - height/2 + roundsize + linewidth,linewidth+0.5,height - roundsize*2,color,color2) -- left
        shader.vertical_gradient_rect(x + width/2,y - height/2 + roundsize,linewidth ,height - roundsize*2 + linewidth,color2,color) -- right
        shader.gradient_rect(x - width/2 + roundsize - linewidth ,y - height/2,width - roundsize*2 + linewidth,linewidth + 0.5,color,color2) -- up
        shader.gradient_rect(x - width/2 + roundsize,y + height/2,width+linewidth - roundsize*2,linewidth,color2,color) -- down
        shader.circle2(x + width/2 - roundsize -1,y - height/2 +roundsize +1.5,roundsize +1 , 1, 45, 0.55,color2) -- right up
        shader.circle2(x + width/2 - roundsize ,y + height/2 -roundsize,roundsize , 1, 45, 0.65, color,0.01,0) -- right down
        shader.circle2(x - width/2 + roundsize - 0.1,y - height/2 +roundsize+0.2,roundsize , 1, 45, 0.5, color,0.01,180) -- left up
        shader.circle2(x - width/2 + roundsize ,y + height/2 -roundsize,roundsize , 1, 45, 0.65, color2,0.01,90) -- left down
    end
end
