function animmove(n,e,speed)
    if global_animmode:get_string() == "Non-linear" then
        local temp = n + (e-n)*(speed/10)
        if (temp > e - 0.005 and temp > e == false) or (temp > e + 0.005 and temp > e - 0.005 == false) then
            return e
        end
        return temp
    else
        local delta = e - n
        if math.abs(delta) <= speed then
            return e
        elseif delta > 0 then
            return n + speed
        else
            return n - speed
        end
    end
end
